import {useState, useEffect} from 'react';


//functions
import { getTest } from './functions/test';
import { getFlavors } from './functions/flavors';

const App = () => {
  const [state, setState] = useState("Hello World");

  useEffect(() => {
    getFlavors().then(res => {
      setState(res[0].name);
    });
  });

  return (
    <div className="App text-3xl font-bold underline">
      <h1>{state}</h1>
    </div>
  );
};


export default App;
